                "content": "Thank you for sharing your concern with us. AutoPay transactions are generally clear within a short duration. However, there are a few exceptional situations where these transactions may take longer to be settled by either the payer’s or the receiver’s bank.\r\nThe money involved in these transactions is traceable and is generally credited to the receiver\u0027s account in the case of successful transactions, or automatically refunded to the sender\u0027s account in the case of failed transactions.\r\n+\r\nUpon examining your concern, according to our record, we understand that, while the transaction did fail, there was no amount deducted from your bank account. We request you to check your account statement which should feature the recent transaction.",
