                "fragmentType": 1,
                "contentType": "text/html",
                "content": "We’ve seen cases where, due to technical/time-out issues at the merchant’s end, debit card transactions might fail. \r\n+\r\nIn such cases, merchants along with the network provider reconcile unclaimed transactions that are auto-reversed to the source account within 5 working days basis the agreed timelines. \r\n+\r\nDuring the waiting period, I request you to reach out to the merchant. In case you don’t receive the refund by \u0026lt;date\u0026gt;, please reach out to us with any of the below details:\r\n1-Decline Slip/Picture of POS confirming the declined transaction.\r\n2-Screenshot/Picture of payment failure at the merchant site.\r\n3-Acknowledgement from the merchant for not receiving the payment.",
