            "messageFragments": [
              {
                "fragmentType": 1,
                "contentType": "text/html",
                "content": "Hurrah! We\u0027ve introduced an amazing feature called \"On-Demand Salary\" which allows you to withdraw your salary in advance.",
                "position": 0
              },
              {
                "fragmentType": 1,
                "contentType": "text/html",
                "content": "+",
                "position": 1
              },
              {
                "fragmentType": 1,
                "contentType": "text/html",
                "content": "Here are the terms and conditions:",
                "position": 2
              },
              {
                "fragmentType": 1,
                "contentType": "text/html",
                "content": "1. The amount that you withdraw in advance needs to be repaid when you receive the salary for that particular month.",
                "position": 3
              },
              {
                "fragmentType": 1,
                "contentType": "text/html",
                "content": "2. The credit limit increases every day until you reach the maximum limit, and it is determined by the salary credited to your bank account.",
                "position": 4
              },
              {
                "fragmentType": 1,
                "contentType": "text/html",
                "content": "4. You can instantly withdraw your salary between the 10th - 28th of any month for emergency purposes or any other reasons.",
                "position": 5
              },
              {
                "fragmentType": 1,
                "contentType": "text/html",
                "content": "5. You will be charged a processing fee of 2%. However, there are two free withdrawals for Pro Salary account holders.\r\n6. You can also opt for automated repayment using the E-Nach mandate linked to your other bank accounts.",
                "position": 6
              },
              {
                "fragmentType": 1,
                "contentType": "text/html",
                "content": "+",
                "position": 7
              },
              {
                "fragmentType": 1,
                "contentType": "text/html",
                "content": "Isn\u0027t this feature awesome? Let me know if you need any more assistance.",
                "position": 8
              }
            ],
