                "content": "We’re extremely sorry to hear this. We’ve examined the issue and it seems that you had an account with Federal Bank before linking it with Jupiter.\r\n+\r\nAs per the regulations, you’re required to repeat KYC periodically otherwise your account will be frozen and you\u0027ll not be able to make any transactions. \r\n+\r\nThe bank tried to communicate with you earlier regarding your savings account. You won’t be able to use your savings account and Pots account with Jupiter as of now as Jupiter is associated with the Federal bank.",
