                "content": "While we appreciate your interest in being a part of Jupiter Money, there seem to be certain issues with the mandatory checks conducted on your application.\r\n+\r\nThese checks are conducted to ensure 100% adherence to the necessary banking guidelines set by the government.\r\n+\r\nRegrettably, we are unable to fulfill your request today. Should there be any suitable opportunities in the future, we\u0027d be happy to consider your application.",
